import { Container, Row, Col } from 'react-bootstrap';
import { useHistory } from 'react-router-dom';
import { DISCIPLINES_ROUTE } from '../utils/consts';
import { NavBar } from '../components/NavBar';
import '../styles/css.css';

const Disciplines = () => {
    const history = useHistory();

    const handleCountryClick = (name) => {
        history.push(`${DISCIPLINES_ROUTE}/${name}`);
    };

    return (
        <Container className="containerStyle">
            <NavBar/>
            <h1 className="h1">Disciplines</h1>
            <Row>
            </Row>
            <Col className="countries">
                <div key='Athletic' className="i" onClick={() => handleCountryClick('Athletics')}>
                    <img className="flag" src='/images/disciplines/Athletics.svg' alt='Athletic' />
                    Athletic
                </div>
                <div key='Swimming' className="i" onClick={() => handleCountryClick('Swimming')}>
                   <img className="flag" src='/images/disciplines/Swimming.svg' alt='Swimming' />
                      Swimming
                </div>
                <div key='Gymnastics' className="i" onClick={() => handleCountryClick('Gymnastics')}>
                    <img className="flag" src='/images/disciplines/Gymnastics.svg' alt='Gymnastics' />
                    Gymnastics
                </div>
                <div key='Basketball' className="i" onClick={() => handleCountryClick('Basketball')}>
                    <img className="flag" src='/images/disciplines/Basketball.svg' alt='Basketball' />
                    Basketball
                </div>
                <div key='Wrestling' className="i" onClick={() => handleCountryClick('Wrestling')}>
                    <img className="flag" src='/images/disciplines/Wrestling.svg' alt='Wrestling' />
                    Wrestling
                </div>
                <div key='Weightlifting' className="i" onClick={() => handleCountryClick('Weightlifting')}>
                    <img className="flag" src='/images/disciplines/Weightlifting.svg' alt='Weightlifting' />
                    Weightlifting
                </div>
                <div key='Diving' className="i" onClick={() => handleCountryClick('Diving')}>
                    <img className="flag" src='/images/disciplines/Diving.svg' alt='Diving' />
                    Diving
                </div>
                <div key='TableTennis' className="i" onClick={() => handleCountryClick('Table Tennis')}>
                    <img className="flag" src='/images/disciplines/TableTennis.svg' alt='TableTennis' />
                    Table Tennis
                </div>
            </Col>
        </Container>
    );
};

export default Disciplines;
